literals:
position: absolute;
  top: 0;
  right: 0;
  padding: 10px;
  background-color: #00467f;
  background-image: url("https://www.transparenttextures.com/patterns/black-linen-2.png");
  border-radius: 0 0 0 5px;

cursor: pointer;
  background-color: #ffffff;
  border: none;
  border-radius: 5px;
  padding: 5px 10px;

  &:first-of-type {
    margin-right: 10px;
  }

  &:hover {
    background-color: #efefefef;
  }

  &:focus {
    outline: none;
  }
